import React, { useState, } from 'react';
import { Form, Button, Col, Container, Jumbotron } from 'react-bootstrap';
import Modal from 'react-modal';
import LogIn from "./../../Modals/LogIn/LogIn"
import  SignIn from "./../../Modals/CreateAccount/createAccount"
import AboutUS from "./../../Modals/AboutUs/aboutUs"
import Background from './../../Components/Images/Freedom.jpg';
import './style.css';



function MainPage() {
	
  const [logInOpen, setLogInOpen] = useState(false);
  const [signInOpen, setSignInOpen] = useState(false);
  const [aboutUsOpen, setAboutUsOpen] = useState(false);
  var sectionStyle = { 
    width: "100%", 
    height: "400px", 
    backgroundImage: "url(" + { Background } + ")" 
}; 

class Section extends Component { 
    render() { 
    return (
     <section style={ sectionStyle }> 
     </section> 
    ); 
    } 
} 
  
  
	return (
		<img src={ Background } > 
		<div className="indexWrap">
			<div className="indexCard">
				<div className="mainPageBtns">
				 <LogIn />
				 <SignIn />
				 <AboutUS />
				 </div>	
		    </div>
		</div>
		</img>
		
	);
}

export default MainPage;
